import './index.css';
import { BrowserRouter,Route,Routes } from "react-router-dom";
import EmployeeLists from "./components/EmployeeLists";

function App() {

  return (
    <div>




      <BrowserRouter>
        <Routes>
          <Route path="/login" element={<Login/>} /> 
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
